import React from 'react';

function SearchResults(props) {
  const { characters } = props;

  return (
    <div>
      <h2>Search Results</h2>
      <ul>
        {characters.map((character) => (
        <li key={character.id}>{character.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default SearchResults;
